;------------------------------------------------------------------------------
; PROJECT: MANA 
; VERSION: 0.0.1
;    FILE: MANA.ASM
;  AUTHOR: CRAIG IANNELLO, PUGBUTT.COM
;
; DESCRIPTION: 
;   DRAWS A TILEMAP FROM SQUARESOFT'S SNES TITLE: "SEIKEN DENSETSU 3".
;   REQUIRES AN HD6309 CPU IN NATIVE MODE AND A V9958 VIDEO DISPLAY PROCESSOR.
;
; THERE IS A COMBINATION COARSE/SMOOTH SCROLLER HAPPENING. THE WHOLE BITMAP 
; IS REDRAWN EVERY EIGHT FRAMES, SCROLLED BY 8 PIXELS. FOR THE INTERIM FRAMES,
; THE POS ADJUST REGISTER IS USED TO SMOOTH THE TRANSITION. THERE'S SOME 
; VISUAL GLITCHES SINCE WE'RE NOT YET WAITING FOR VBLANK BEFORE PAGE-FLIPPING,
; ETC.
;
;------------------------------------------------------------------------------
    INCLUDE BIOS_FUNC_TAB.D     ; BIOS FCN JUMP TABLE AND CONSTANTS
    INCLUDE DEFINES.D
;------------------------------------------------------------------------------
            ORG     $1000   ; VARS
; -----------------------------------------------------------------------------
; PROGRAM ENTRYPOINT
; -----------------------------------------------------------------------------
ENTRYPOINT  
    LDX  #VDP_G4_SEQ            ; SET MODE GRAPHICS4
VDP_INIT    
    LDA  ,X+
    STA  VREG
    CMPX #(VDP_G4_SEQ+VDP_G4_SZ)
    BLO  VDP_INIT
    LDX  #PALETTE               ; SET 16-COLOR PALETTE
    LDA  #0
    STA  VREG
    LDA  #$90
    STA  VREG
SET_PAL
    LDA  ,X+
    STA  VPAL
    LDA  ,X+
    STA  VPAL
    CMPX #END_PAL
    BLO  SET_PAL
    LDX  JT_FIRQ+1              ; PRESERVE DEFAULT FIRQ ISR ADDRESS,
    STX  VSNEXTISR              ; FOR USE WHEN A NON-VDP FIRQ HAPPENS.
    LDX  #VDP_FIRQ              ; GET ADDRESS OF OUR ISR,
    STX  JT_FIRQ+1              ; AND INSERT IT IN FIRQ JUMP TABLE.
    LDD  #0
    STD  SCROLL_POS             ; INITIAL SMOOTH SCROLL POS 0
    CLR  VID_PAGE               ; INITIAL GFX PAGE 0
DRAWLOOP    
    LDA  #0         ; INITIAL SMOOTH SCROLL POS IS ZERO
    STA  SSH
    STA  VREG
    LDA  #$92
    STA  VREG
    LDA  #3         ; RESET SMOOTHSCROLLER'S 3-ROW COUNTDOWN
    STA  SCD
    LDA  VID_PAGE   ; CHECK WHICH GFX PAGES WE WANT TO SHOW/UPDATE
    BNE  DO_PAGE1
DO_PAGE0
    LDA  #$3F       ; SELECT GRAPHIC PAGE 2/4 (MID 2 BYTES OF TOP NYBBLE)
    STA  VREG
    LDA  #$82
    STA  VREG
    ; 1 101010 0000 0000
    ; x   x   x   x   x   A16 A15 A14
    LDA  #$00       ; SET VRAM WRITE ADRS TO $0000 (PAGE 1/4 )
    STA  VREG
    LDA  #$8E
    STA  VREG
    ; A7  A6  A5  A4  A3  A2  A1  A0
    LDA  #$00
    STA  VREG
    ; 0   /RD A13 A12 A11 A10 A9  A8
    LDA  #$40   ; $40 pg 1
    STA  VREG
    LDA  #1
    STA  VID_PAGE
    JMP  START_SCROLL
DO_PAGE1
    LDA  #$1F       ; SELECT GRAPHIC PAGE 1/4 (MID 2 BYTES OF TOP NYBBLE)
    STA  VREG
    LDA  #$82
    STA  VREG
    ; 1 101010 0000 0000
    ; x   x   x   x   x   A16 A15 A14
    LDA  #$02       ; SET VRAM WRITE ADRS TO $8000 (PAGE 2/4)
    STA  VREG
    LDA  #$8E
    STA  VREG
    ; A7  A6  A5  A4  A3  A2  A1  A0
    LDA  #$00
    STA  VREG
    ; 0   /RD A13 A12 A11 A10 A9  A8
    LDA  #$40   ; $40 pg 1
    STA  VREG
    LDA  #0
    STA  VID_PAGE
START_SCROLL
    LDD  #TILEMAP   ; POINTER TO TILEMAP (ARRAY OF TILE ADDRESSES)
    ADDD SCROLL_POS
    TFR  D,U
    LDD  SCROLL_POS
    ADDD #2         ; COARSE SCROLL TILEMAP LEFT 1 TILE
    STD  SCROLL_POS
    CMPD #864       ; IF CANT COARSE SCROLL ANYMORE,
    BGE  RESET_SCROLL ; RESET SCROLL POS.
DONESCROLL            
    LDB  #24         ; TILE ROW COUNTER
MAP_ROWS    
    LDF  #32        ; TILE COLUMN COUNTER
    LDY  #TILEBUF   ; 1 KB DEST BUFFER FOR RENDERED TILES
MAP_ROW     
    LDX  ,U++       ; GET NEXT TILE ADDRESS FROM TILEMAP
    LDE  #8         ; TILE PIXEL ROW COUNTER
TILE_DRAW
    LDA  ,X+        ; RENDER AN 8-PIXEL ROW OF TILE
    STA  ,Y+
    LDA  ,X+
    STA  ,Y+
    LDA  ,X+
    STA  ,Y+
    LDA  ,X+
    STA  ,Y+
    LEAY 124,Y      ; STRIDE TO NEXT PIXEL ROW OF DEST BUFFER
    DECE
    BNE  TILE_DRAW
    LEAY -1020,Y    ; RESET DEST BUF ADRS TO NEXT TILE POS.
    DECF 
    BNE  MAP_ROW    ; LOOP TO RENDER ALL TILES OF THE MAP ROW
    LDX  #TILEBUF
VDP_COPY
    LDA  ,X+        ; COPY RENDERED TILEROW TO VDP
    STA  VDAT
    CMPX #(TILEBUF+1024)
    BLO  VDP_COPY
    LEAU ((TILEMAP_W-32)*2),U  ; STRIDE TO NEXT TILEMAP ROW
    ; EVERY THREE TILE ROWS, SMOOTH-SCROLL BY ONE PIXEL
    ; $VH,$92   H= (LEFTMOST) 7 .. 1 ,(CENTER) 0, H=15..8 (RIGHTMOST)
    ; V=8..15 (BOTTOM), 1..7 (TOP)
    DEC  SCD
    BNE  SKIPSS
    INC  SSH
    LDA  SSH
    STA  VREG
    LDA  #$92
    STA  VREG
    LDA  #3         ; RESET 3-ROW COUNTDOWN
    STA  SCD
SKIPSS
    DECB
    BNE  MAP_ROWS   ; LOOP UNTIL ALL MAP ROWS ARE DRAWN.
LOOPEND
    JSR  BF_UT_GETC ; PRESS ESCAPE TO EXIT DEMO,
    CMPA #$1B
    LBNE DRAWLOOP   ; OR WE'LL KEEP REDRAWING.
    LDX  VSNEXTISR  ; REMOVE OUR JUMP TABLE ENTRY
    STX  JT_FIRQ+1  ; (REPLACE WITH ORIG VALUE)
    RTS             ; ALL DONE.

RESET_SCROLL
    LDD  #0
    STD  SCROLL_POS            
    JMP  DONESCROLL
; -----------------------------------------------------------------------------
; FIRQ  - can be called by the VDP for VBLANK, HBLANK, scanline, sprite, etc.
; -----------------------------------------------------------------------------
VDP_FIRQ:    
    PSHS A,B,X,Y,U
    PSHSW     ; PUSH W ALSO

    ; ALSO TODO: MAKE THE VDP VBLANK STUFF IN HERE ONLY HAPPEN IF IT THE
    ; FIRQ WAS REALLY CAUSED BY A VBLANK AND NOT SOMETHING ELSE LIKE HBLANK
    ; OR A NON-VDP FIRQ.

    CLRA        ; GET VDP STATUS REGISTER S#0 TO DETERMINE INTERRUPT SOURCE
    STA VREG    ; AND CLEAR THE INTERRUPT.
    LDA #143
    STA VREG
    LDA VREG
    STA VDP_INTRRUPT_REASON ; NOTE REASON TODO: NON-VBLANK HANDLERS

    ;TIM #1,VDP_CURS_STYLE   ; TEST CURSOR VISIBILITY,
    ;BEQ CURSOR_UPDATE_DONE  ; IF CURSOR DISABLED, SKIP CURSOR STUFF

FIRQ_DONE:
    PULSW                   ; POP W TOO
    PULS A,B,X,Y,U
    RTI     
; -----------------------------------------------------------------------------
VDP_G4_SZ   EQU     16      ; INIT SEQ FOR VDP MODE GRAPHICS4 (256 X 192 X 16)
; $80, $89 - 212 lines
; $00, $89 - 192 lines
VDP_G4_SEQ  FCB     $00,$99,$06,$80,$40,$81,$0A,$88,$00,$89,$1F,$82,$00,$8E,$00,$40
TILEBUF                 RMB 1024    ; FOR RASTERIZING ONE ROW OF TILES
SCROLL_POS              RMB 2       ; FOR COARSE SCROLLING
VID_PAGE                RMB 1       ; FOR PAGE-FLIPPPING
SSH                     RMB 1
SCD                     RMB 1
VDP_INTRRUPT_REASON     RMB 1
VSNEXTISR               RMB 2
; -----------------------------------------------------------------------------
; PALETTE, TILE MAP, TILES, AND RELATED DEFS.
;
; TO MAKE THIS DATA, I FOUND ONLINE A FAN-MADE PNG IMAGE OF THE MAP AND WROTE
; A PYTHON SCRIPT WHICH LOADS THIS FILE AND EXAMINE THE IMAGE AS A SERIES 
; OF 8X8 PIXEL TILES:
;
; FOR EACH TILE, THE SCRIPT CHECKS IF IT HAS BEEN SEEN BEFORE, AND IF NOT, 
; IT IS ADDED TO A TABLE OF UNIQUE TILES' GRAPHICS CALLED 'TILES'. WE NOW KNOW
; WHICH TILE INDEX BELONGS IN THAT SQUARE OF THE MAP, SO THAT IS ADDED TO A 
; TABLE CALLED 'TILEMAP'.
;
; IDEALLY, THERE WILL BE SEVERAL DUPLICATE TILES USED IN THE IMAGE, AND SINCE
; WE ONLY NEED TO KEEP ONE COPY OF EACH UNIQUE TILE, THE FINAL FILE SIZE
; SHOULD OCCUPY MUCH LESS SPACE THAN THE ORIGINAL IMAGE.
;
; -----------------------------------------------------------------------------
TILEMAP_W   EQU 108         ; MAP WIDTH IN TILES
TILEMAP_H   EQU  36         ; MAP HEIGHT IN TILES
NUM_TILES   EQU 518         ; NUM TILES IN TILESET

PALETTE                     ; 16-COLOR PALETTE %.RRR.BBB %.....GGG
